CREATE DATABASE /*!32312 IF NOT EXISTS*/`my_store` /*!40100 DEFAULT CHARACTER SET latin1 */;

USE `my_store`;

/*Table structure for table `category` */

DROP TABLE IF EXISTS `category`;

CREATE TABLE `category` (
  `c_id` varchar(20) NOT NULL,
  `c_title` varchar(100) default NULL,
  `c_description` varchar(250) default NULL,
  PRIMARY KEY  (`c_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `category` */

insert  into `category`(`c_id`,`c_title`,`c_description`) values ('1','Wooden Crafts','Wooden showpieces, craftitems\r\n'),('2','Jewellery','Earrings, Necklaces'),('3','Fashion ','Saree');

/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

