/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `username` varchar(100) default NULL,
  `email` varchar(50) default NULL,
  `password` varchar(20) default NULL,
  `confirm_password` varchar(20) default NULL,
  `mobile_number` varchar(20) default NULL,
  `address` varchar(100) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `user` */

insert  into `user`(`username`,`email`,`password`,`confirm_password`,`mobile_number`,`address`) values ('admin','admin@gmail.com','admin@123','admin@123','0123456789','Ujjain,MP,India'),('Priya','priya@gmail.com','1234','1234','12345679','ujjain');

